using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Logging;
using OpenCvSharp;
using QrCodeWeb.Datas;
using QrCodeWeb.Services;
using Serilog;
using System.Xml.Linq;
using static System.Net.Mime.MediaTypeNames;

namespace QrCodeWeb.Controllers
{
    [ApiController]
    [Route("[controller]")]
    public class DeCodeController : Controller
    {
        private DeCodeService CodeService { get; set; }
        private readonly ILogger<DeCodeController> Logger;
        private IWebHostEnvironment Environment { get; set; }

        public DeCodeController(DeCodeService deCode, ILogger<DeCodeController> logger, IWebHostEnvironment environment)
        {
            CodeService = deCode;
            Logger = logger;
            Environment = environment;
        }

        /// <summary>
        /// Post 请求
        /// </summary>
        /// <param name="code">base64 字符串</param>
        /// <returns></returns>
        [HttpPost(Name = "DeCode")]
        public ResponseModel DeCode([FromBody] string code)
        {
            DateTime startTime = DateTime.Now;// - new DateTime(1970, 1, 1, 0, 0, 0, 0);
            try
            {
                ResponseModel response = new ResponseModel();
                //     var base64code = "";
                if (code.Length < 110)
                {
                    response.Code = "501";
                    response.Message = "参数无效";
                    return response;
                }
                Logger.LogInformation($"接收到请求,Base64:{code.Substring(0, 100)}......");

                Mat mat = Base64Expand.ToaMat(code);
                if (mat.Empty())
                {
                    Logger.LogInformation($"base64转图片失败");
                    response.Message = "base64解码失败";
                    response.Code = "500";
                    return response;
                }

                Logger.LogInformation($"成功转换成图片:宽：{mat.Width},高：{mat.Height}");

                SaveMatFile(mat, "Base64ToMat原图");

                CodeService.FileNmae = "inimges";

                CodeService.DetectAndDecode(mat, ref response);
                // response.DeQRcodeContent = code;
                TimeSpan span = DateTime.Now - startTime;
                response.DateTime = $"{(int)span.TotalMilliseconds}";
                Logger.LogInformation($"请求完成，本次耗时：{(int)span.TotalMilliseconds} 毫秒");
                Logger.LogInformation("");
                return response;
            }
            catch (Exception e)
            {
                Log.Information($"程序运行出现异常：{e.StackTrace}");
                return new ResponseModel()
                {
                    Code = "500",
                    Message = $"程序异常:{e.Message}"
                };

                //  throw;
            }
        }

        private Task SaveMatFile(Mat array, string name, string FileNmae = "0000")
        {
            var filepathw = Path.Combine(Environment.ContentRootPath, $"testdata");
            if (!Directory.Exists(filepathw))
            {
                Directory.CreateDirectory(filepathw);
            }

            var filepathw2 = Path.Combine(filepathw, $"{FileNmae}");

            if (!Directory.Exists(filepathw2))
            {
                Directory.CreateDirectory(filepathw2);
            }

            var filepath = Path.Combine(filepathw2, $"{FileNmae}_{name}.jpg");
            // Mat image = array.GetMat();

            //ImageEncodingParam param = new ImageEncodingParam(ImageEncodingFlags.);
            array.SaveImage(filepath);

            return Task.CompletedTask;
        }
    }
}